import apiHandler from "../api/APIHandler";

import AdsDisplayedOnProfile from "../components/ad/AdsDisplayedOnProfile"
import OneComment from "../components/comments/OneComment"

import { Link } from "react-router-dom";


export default class UserPublicProfile extends Component {
    state = {
        user: ""
    }

    componentDidMount() {
        apiHandler.get("/user").then(apiRes => {
            this.setState({ user: apiRes.data.user });
        });
    };


    render() {
        const { artist } = this.state;
        console.log(this.props, this.state);

        return (
            <>
                <h1 className="title">Artist details</h1>
                <h2 className="artist-name">{this.state.name}</h2>
                <p>{this.state.name}</p>
                <p>{this.state.style}</p>
                <p>{this.state.description}</p>
                <p>{this.state.isBand}</p>
                <p>{this.state.rates}</p>

            </>
        )
    }
}
